import React from 'react';
import { useState } from 'react';
import ReactDatePicker from 'react-datepicker';
function Date(props) {
    const[startDate,setStartDate]=useState(new Date());
    return (
        <div>
            
            <ReactDatePicker
            showIcon
            selected={startDate}
            on onChange={(d)=>
            setStartDate(d)}
            >

            </ReactDatePicker>
            
        </div>
    );
}

export default Date;
